import React from 'react';
import { styled } from '@mui/material/styles';
import {Grid,Divider} from '@mui/material';

const Dashboard = () => {
  const Container = styled(Grid)({
    padding: `30px`
  });
  const MyDivider = styled(Divider)({
    padding: `30px`
  });

  return (
    <div>
      <Container>
        <Grid xs={6}>
          today
          2023.02.09
        </Grid>
        <MyDivider/>
        <Grid xs={3}>

        </Grid>
      </Container>
    </div>
  )
}

export default Dashboard
